import React, { Component } from 'react'
import background from './mountain.png';
import icon from './info.png';
import contact from './contact.jpg';
import Navigation from './navigation.js'


class Welcome extends Component {
  render () {
    return (
      <div className="container">
      <img  src={background} className="img"/>
      <h1 className="center" style={this.hStyle}>WELCOME TO THE BANK OF THE SUN</h1>
      <center>
      <img className="icon " src= {icon} style={this.icon1Style}/>
      <img className="icon " src={contact} style={this.icon2Style}/>
      </center>
    </div>
    );

  }
}

export default Welcome;
